            }

            }

                margin-top: 10px;
            }
        }

    // Função para realizar a busca da unidade de saúde
    function searchHealthcare() {
      const streetOrCepInput = document.getElementById("streetOrCep");
      const healthcareUnitInput = document.getElementById("healthcareUnit");
      const resultDiv = document.getElementById("result");

      const streetOrCep = streetOrCepInput.value.trim().toLowerCase();
      const healthcareUnit = healthcareUnitInput.value.trim().toLowerCase();

      // Verificar se pelo menos um dos campos de busca foi preenchido
      if (streetOrCep === "" && healthcareUnit === "") {
        resultDiv.innerHTML = "<p>Preencha pelo menos um dos campos de busca.</p>";
        resultDiv.style.display = "block";
        return;
      }

      // Filtrar os dados com base nos valores inseridos pelo usuário
      const filteredData = healthcareData.filter((data) => {
        const isAddressMatched = streetOrCep === "" || data.street.toLowerCase().includes(streetOrCep) || data.cep === streetOrCep;
        const isHealthcareUnitMatched = healthcareUnit === "" || data.healthcareUnit.toLowerCase().includes(healthcareUnit);
        return isAddressMatched && isHealthcareUnitMatched;
      });

// Ordenar os dados filtrados por rua (street) e, em seguida, por ordem numérica de houseNumberFrom a houseNumberTo
    filteredData.sort((a, b) => {
      if (a.street < b.street) return -1;
      if (a.street > b.street) return 1;
      return a.houseNumberFrom - b.houseNumberFrom;
    });

      // Exibir os resultados na página
      if (filteredData.length > 0) {
        let resultHTML = "<h3>Resultado da busca:</h3>";
        resultHTML += "<ul>";
        filteredData.forEach((data) => {
          resultHTML += `
            <li>
              <strong>Endereço:</strong> ${data.street} - CEP: ${data.cep} <br>
              <strong>Faixa de Numeração:</strong> ${data.houseNumberFrom} - ${data.houseNumberTo} <br>
              <strong>Lado:</strong> ${data.side} <br>
              <strong>Unidade de Saúde Responsável:</strong> ${data.healthcareUnit}
            </li>
          `;
        });
        resultHTML += "</ul>";
        resultDiv.innerHTML = resultHTML;
      } else {
        resultDiv.innerHTML = "<p>Nenhum resultado encontrado.</p>";
      }

      // Exibir a div de resultados
      resultDiv.style.display = "block";
    }

  function handleSearchOnEnter(event) {
      if (event.keyCode === 13) {
        searchHealthcare();
      }
    }

    // Adicione event listeners para os campos de busca
    const streetOrCepInput = document.getElementById("streetOrCep");
    const healthcareUnitInput = document.getElementById("healthcareUnit");

    streetOrCepInput.addEventListener("keydown", handleSearchOnEnter);
    healthcareUnitInput.addEventListener("keydown", handleSearchOnEnter);
  </script>

                           "<p>2- Ao pesquisar utilizando o CEP é obrigatório o uso do hífen (-).</p>" +
                           "<p>3- Quaisquer inconsistências ou erros encontrados, favor entrar em contato pelo e-mail:                                           sistemas.saude@marilia.sp.gov.br.</p>";

            var popup = window.open("", "popup", "width=400,height=300");
            popup.document.write("<div style='font-size: 16px; text-align: justify; padding: 20px;'>" + mensagem + "</div>");
        }
